contracts/votingSystem.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VotingSystem {
    enum Party { PartyA, PartyB, ThirdParty }

    struct Voter {
        bool voted;
        Party preference1;
        Party preference2;
    }

    mapping(address => Voter) public voters;
    address[] public voterAddresses; // Store voter addresses for iteration
    uint256[3] public votes; // Index 0 for PartyA, 1 for PartyB, 2 for ThirdParty

    address public chairperson;
    bool public votingClosed = false;

    constructor() {
        chairperson = msg.sender;
    }

    modifier onlyChairperson() {
        require(msg.sender == chairperson, "Only chairperson can call this function");
        _;
    }

    modifier onlyBeforeVotingClosed() {
        require(!votingClosed, "Voting is closed");
        _;
    }

    function vote(Party preference1, Party preference2) public onlyBeforeVotingClosed {
        require(!voters[msg.sender].voted, "Already voted");
        require(preference1 != preference2, "Preferences must be different");

        voters[msg.sender] = Voter(true, preference1, preference2);
        voterAddresses.push(msg.sender); // Keep track of the voter address
        votes[uint(preference1)]++;
    }

    function closeVoting() public onlyChairperson {
        require(!votingClosed, "Voting already closed");
        votingClosed = true;

        // Redistribution of ThirdParty votes
        if (votes[0] + votes[1] <= 50) {
            redistributeThirdPartyVotes();
        }
    }

    function redistributeThirdPartyVotes() private {
        for (uint i = 0; i < voterAddresses.length; i++) {
            Voter memory voter = voters[voterAddresses[i]];
            if (voter.voted && voter.preference1 == Party.ThirdParty) {
                votes[uint(voter.preference2)]++;
            }
        }
        votes[2] = 0; // Reset ThirdParty votes after redistribution
    }

    function winningParty() public view returns (Party) {
        require(votingClosed, "Voting is not closed yet");
        return votes[0] > votes[1] ? Party.PartyA : Party.PartyB;
    }
}

